                {/* <EmpireHunt /> */}
            </div>
            
            <div>
                <h4>Dreaming City - Curse Week and Ascendant Challenge</h4>
                {/* <DreamingCityRotations /> */}
            </div>
        </div>
    );
};

export default Weekly;
